import logo from './logo.svg';
import './App.css';
import styled from 'styled-components';
import Typed from "react-typed"

function App() {
  return (
    <div className="App">
      <Img src= 'correct.png' />
      <h2>Thank you for getting in touch! <br/> </h2>
      <Link href="url">Back to the Website</Link>
    </div>
  );
}

export default App;


const Img = styled.img`
width: 15em;
margin-top: 1em;
`;

const Link = styled.a`
color: green;

`;
